DROP TABLE IF EXISTS `creature_template_scaling`;
CREATE TABLE `creature_template_scaling` (
  `Entry` MEDIUMINT UNSIGNED NOT NULL,
  `LevelScalingMin` SMALLINT UNSIGNED NOT NULL DEFAULT 0,
  `LevelScalingMax` SMALLINT UNSIGNED NOT NULL DEFAULT 0,
  `LevelScalingDeltaMin` SMALLINT NOT NULL DEFAULT 0,
  `LevelScalingDeltaMax` SMALLINT NOT NULL DEFAULT 0,
  `LevelScalingDuration` INT UNSIGNED NOT NULL DEFAULT 0,
  `VerifiedBuild` SMALLINT DEFAULT NULL,
  PRIMARY KEY (`Entry`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- data from ashamane db

-- merge in any data that ashamane doesn't have
SELECT ct.`entry`, ct.`ScaleLevelMin`, ct.`ScaleLevelMax`, ct.`ScaleLevelDelta` as `ScaleLevelDeltaMin`, ct.`ScaleLevelDelta` as `ScaleLevelDeltaMax`, ct.`ScaleLevelDuration`
FROM `creature_template` ct
LEFT OUTER JOIN `creature_template_scaling` cts ON cts.`Entry` = ct.`entry`
WHERE cts.`Entry` IS NULL AND (ct.`ScaleLevelMin` > 0 OR ct.`ScaleLevelMax` > 0 OR `ScaleLevelDuration` > 0);

UPDATE `creature_template_scaling`
INNER JOIN `creature_template` ON `creature_template`.`entry` = `creature_template_scaling`.`Entry`
SET `LevelScalingDuration` = `ScaleLevelDuration` WHERE `ScaleLevelDuration` > 0;

